import styled from "styled-components";


function PlaylistEntry(props){
    return (
        <OuterDiv>
            <h1>playlist</h1>
            <ul>
                <Li>
                    <a href={props.imageUrl}>image url</a>
                </Li>
                <Li>
                    <a href={props.playlistUrl}>playlist url</a>
                </Li>
                <Li color="green">
                    <p>{JSON.stringify(props.artists)}</p>
                </Li>
            </ul>
        </OuterDiv>

    )
}

const OuterDiv = styled.div`
    border: 3px solid red;
`

const Li = styled.li`
    color: blue;
    background: ${props=>props.color || "red"};
`

export default PlaylistEntry;
